import React from "react";
import { BrowserRouter as Router, Route } from "react-router-dom";
import Home from "../../Home";
import News from "./News";

function App() {
  return (
    <Router>
      <Route exact path="/" component={Home} />
      <Route exact path="/news" component={News} />
    </Router>
  );
}

export default App;
